import * as React from 'react';
import styled from 'styled-components';
import { CartProvider } from 'use-cart';
import Home from './components/Home';

function App() {
  return (
    <CartProvider>
      <Container>
        <Home />
      </Container>
    </CartProvider>
  );
}

const Container = styled.div`
  color: #fff;
  height: 100vh;
  width: 100%;
`;

export default App;
